import React from 'react';

const About = () => {
  return (
    <div>
      <h1>About this page</h1>
      <p className='my-1'>
        This is a Full Stack React App for Keeping Contacts
      </p>
      <p className='bg-dark p'>
        <strong>Version 1.0</strong>
      </p>
    </div>
  );
};

export default About;
